            position: 'absolute',
            left: 0,
            bottom: 0,
            height: "100px",
            width: "100%",
            overflow: 'hidden'
        }}>
            <div className="container text-center  bg-dark">
                <small>Copyright &copy; Micha≈Ç Mikulski</small>
            </div>
        </footer>
    )
}

